const CourseCard = () => {
  return (
    <div>
      <div class="card">
        <img
          class="card-img-top"
          src="http://www.tutorialesprogramacionya.com/imagenes/cuadro2.jpg"
        />
        <div class="card-img-overlay">
          <h4 class="card-title">Titulo de la tarjeta 1</h4>
          <p class="card-text">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam
            lectus sem, tempor vitae mattis malesuada, ornare sed erat.
            Pellentesque nulla dui, congue nec tortor sit amet, maximus mattis
            dui.{" "}
          </p>
          <a href="#" class="btn btn-primary">
            Entrar
          </a>
        </div>
      </div>
    </div>
  );
};

export default CourseCard;
